import React from 'react';
import Head from 'next/head'

const JumboCard = (props) => {
  return (
    <div style={{textAlign: "center", paddingBottom: "2rem"}}>
      <div className="jumboContainer" style={{display: "inline-block", background: "white"}}>
          <div>
              <div>
              <img src="/Temasek.jpg" alt="my image" style={{width: "80%", padding: "2rem", borderRadius: "2.5rem"}}/>
                 <h1 className="display-3" style={{fontSize: "2rem", fontWeight: "400"}}><a style={{textDecoration: "none", color:"#3377CC"}} href="https://www.temasek.com.sg/en/index">Temasek Holdings</a></h1>
                 <p className="lead" style={{fontSize: "1rem",fontWeight: "400"}} >Incoming Software Engineering Intern</p>
                 <hr className="my-2" />
                 <p style= {{fontSize: '0.9rem'}}>Part of the Temasek Digital Team</p>
                 <p className="lead">
                </p>
              </div>
          </div>
        <style jsx>{`
           @media (max-width: 500px) {
                    .jumboContainer {
                    width: 90vw;
                    font-family: "Roboto";
                    }
                }
            @media (min-width: 500px) {
                .jumboContainer {
                width: 60vw;
                font-family: "Roboto";
                }

                a:hover {
                    transform: scale(1.15);
                    transition-duration: 0.5s;
                }

            }
        `} </style>
      </div>
    </div>
  );
};

export default JumboCard;
